    public int firstUniqueNumber(int[] nums, int number) {
        // Write your code here
        Queue<Integer> queue = new LinkedList<>();
        Set<Integer> allSet = new HashSet<>();
        Set<Integer> repeatSet = new HashSet<>();
        int i;
        for ( i = 0; i < nums.length; i++) {
            // 第一次出现重复，添加到allSet和list中
            if ( !allSet.contains(nums[i]) ){
                allSet.add(nums[i]);
                queue.offer(nums[i]);
            }else { // 已经出现过，不知道是多少次
                repeatSet.add(nums[i]); //添加到重复Set中，如果已有元素，自动略过
            }
            if (nums[i] == number){
                break;
            }
        }
        if ( i < nums.length && queue.size() > 0){  // 必须是提前退出的，就算指定的是最后一个元素，只要没有经过最后一个i++,i都是小于length
            while (queue.size() > 0){
                int temp = queue.poll();
                if ( !repeatSet.contains(temp)){    //不在重复数组中
                    return temp;
                }
            }
        }
        return -1;  // 队列里没找到只出现一次的元素
    }



